import { Component, Input, isStandalone, Output, NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';

@Component({
  selector: 'app-register-page1',
  templateUrl: './register-page1.component.html',
  styleUrls: ['./register-page1.component.css'],
  inputs: ['nextFn', 'prevFn'],
  providers: [FormsModule]
})
export class RegisterPage1Component {
  password: string = "";
  confirm_password: string = "";
  @Input() nextFn!: Function;
  @Input() prevFn!: Function;

  validate () {
    if (this.password === this.confirm_password) {
      console.log("Passwords match");
      return true;
    }
    else {
      console.log("Passwords do not match");
      return false;
    }
  }
  finish () {
    if (this.validate()) {
      this.nextFn();
    }
  }
}
<form>
    <h2>Create a password to secure your account</h2>
    <div class="form-group">
        <label for="password">Password</label>
        <input [(ngModel)]="password" type="password" class="form-control" id="password" placeholder="Password">
    </div>
    <div class="form-group">
        <label for="confirmPassword">Confirm Password</label>
        <input type="password" class="form-control" id="confirmPassword" placeholder="Confirm Password">
    </div>
    <div class="form-group">
        <button type="button" class="btn btn-primary" (click)="finish()">Next</button>
        <button type="button" class="btn btn-secondary" (click)="prevFn()">Back</button>
    </div>
</form>
